import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

<div id="div1">
  <p id="p1">This is a paragraph.</p>
  <p id="p2">This is another paragraph.</p>
</div>

ReactDOM.render(<App />, document.getElementById("root"));
